import { Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [RouterOutlet],
  template: `
    <h1>Welcome to {{title}}!</h1>

    <router-outlet />
  `,
  styles: [],
})
export class AppComponent {
  title = 'angular-latest';
}

import { Component,Input } from '@angular/core';
import '@fluentui/web-components/button.js';


export type ButtonAppearance = 'accent' | 'lightweight' | 'neutral' | 'outline' | 'stealth';


@Component({
  selector: 'app-fluent-button-wrapper',
  template: `
  <fluent-button
  [appearance]="appearance"
  [attr.disabled]="disabled ? true : null"
  [attr.disabled-focusable]="disabledFocusable ? true : null"
  [attr.icon-only]="iconOnly ? true : null"
  [attr.icon]="icon"
  (click)="onClick()"
>
  {{ content }}
</fluent-button>

  `,
  styles: [],
})
export class ButtonComponent {
  @Input() appearance: ButtonAppearance = 'accent'; 
  @Input() disabled: boolean = false;
  @Input() disabledFocusable: boolean = false;
  @Input() iconOnly: boolean = false;
  @Input() icon: string | null = null;
  @Input() content: string = 'Button';


  exampleTextField = '';

  onClick() {
    console.log(this.exampleTextField);
  }
  

}

import { Component,Input } from '@angular/core';

import '@fluentui/web-components/checkbox.js';


@Component({
  selector: 'app-fluent-checkbox-wrapper',
  template: `
<fluent-checkbox [name]="name" [checked]="checked" [disabled]="disabled" > {{message}}</fluent-checkbox>
  `,
  styles: [],
})
export class CheckboxComponent {
    @Input() checked: boolean = false;
    @Input() disabled: boolean = false;
    @Input() name: string = "checkbox";
    @Input() message:string = "";
  

}

